javascript:(() => {document.querySelector("html").onclick=(e=>{if(e.target.classList.contains("commit-id")){"true"===e.target.dataset.isDiffSelected?(e.target.style["background-color"]="",e.target.dataset.isDiffSelected=!1):(e.target.dataset.isDiffSelected=!0,e.target.style["background-color"]="#404040");const t=document.querySelectorAll('a[data-is-diff-selected="true"]');if(2===t.length){t.forEach(e=>{e.style["background-color"]="",e.dataset.isDiffSelected=!1});let e=document.querySelector(".repohead-details-container > h1 > strong > a").href;document.querySelector("html").onclick=null,window.open(`${e}/compare/${t[0].innerText}...${t[1].innerText}`)}return!1}});})()
